import React,{ useState, useEffect } from "react";
import '../styles.css';

export default function MoviesGrid(){
    const [movies, setMovies] = useState<string[]>([]);

    useEffect(() => {
        const m: string[] = ["a", "b"];
        setMovies(m);
    }, [])

    return (
        <div>{movies.length}
        </div>
    );
}
